def extGcd(a, b):
	r = a % b
	if r == 0:
		return (0, 1)
	(x, y) = extGcd(b, r)
	return (y, x - y * (a / b))

def invMod(a, m):
	(inva, y) = extGcd(a, m)
	if inva < 0:
		inva += m
	return inva

